const ForgetPassword = () => {
    return (
        <div className="inline-grid mt-20 w-full ">
            <div className=" mt-4">
                <h1 className='text-center font-extrabold text-2xl text-stone-600 '>Forget Password</h1>

                <form className="mt-7">
                    <div >
                        <label> Verify Email</label>
                        <input type="email" className="mx-4 rounded-lg px-3 w-96 h-10" placeholder="Enter your email " required />
                    </div>
                    <input type="submit" value='Forget Password' className="mx-3 my-5 px-3 py-2 rounded-2xl bg-red-500" />
                </form>


            </div>
        </div>
    )
}


